import React from 'react';
import styles from './Sponsor.css';

const Sponsor = () => {
  return (
    <div className='conteiner'>
        <a className='img' href=''>
          <img src="https://burgwagen.com.ar/wp-content/uploads/2021/01/BUG-banner-dic-02.jpg" alt="Volkswagen Banner" />
        </a>
    </div>
  )
}

export default Sponsor;
